        {value:false, id:"square-"+nanoid(), key:nanoid()},  
        {value:false, id:"square-"+nanoid(), key:nanoid()},
    ];
    const row5 = [
        // {id:"row-"+nanoid()},
        {value:true, id:"square-"+nanoid(), key:nanoid()},
        {value:true, id:"square-"+nanoid(), key:nanoid()},
        {value:true, id:"square-"+nanoid(), key:nanoid()},
        {value:true, id:"square-"+nanoid(), key:nanoid()},
        {value:true, id:"square-"+nanoid(), key:nanoid()},
    ];

    const rows = [row1, row2, row3, row4, row5];

    const gameRows = rows.map(row=>{
        return Object.assign({id:"gameRow-"+nanoid()}, row);
    });

    const tutorial = rows.map(row => {
        for(let i = 0; i < gameRows.length; i++) {
            console.log("game row id: " +gameRows[i].id)
            for(let j = 0; j < gameRows[i].length; j++) {
                console.log("square? id: "+ gameRows[i][j].id)
            }
        }
    });

    // return (
    //     <Row 
    //         row={row}
    //         id={gameRows[i].id}
    //         key={'row-'+nanoid()}
    //     />
    // );

    const board = <Board gameRows={gameRows} length={row1.length} height={gameRows.length} />

    return (
        <div>
            {board}           
            <div className='level'>
                {tutorial}
                {console.log(gameRows)}
            </div>
        </div>
    );
}
